import React from 'react';
import { useDispatch, useSelector, batch} from 'react-redux';
import { Link } from 'react-router-dom';
import { FiMenu } from 'react-icons/fi';

import user from '../reducers/user'
// import Logo from './Logo';
import { NavbarWrapper, LogoWrapper, HeaderLogo, NavMenu, ButtonWrapper, Button } from '../components/styled-components/NavbarElements'
import logoImg from '../assets/logo.png';

import NavLinksUser from './NavBar/NavLinks'
import NavLinksVisitor from './NavBar/NavLinksVisitor'

const style = { color: "white", fontSize: "2em" }

const Navbar = () => {
  const dispatch = useDispatch()
  const accessToken = useSelector(store => store.user.accessToken)

  const onButtonClick = () => {
    batch(() => {
      // remove user from localStorage
      localStorage.removeItem('user')
      dispatch(user.actions.setUsername(null));
      dispatch(user.actions.setAccessToken(null))
    })
  }

  if (accessToken) {
    return (  
      <>
        <NavbarWrapper> 
          <LogoWrapper>
            <FiMenu style={ style } /> 
            <HeaderLogo src={logoImg} alt="petspotter-logo" />
          </LogoWrapper>          
          <NavMenu>
          <ButtonWrapper>
            <Link to="/create-post">
              <Button className="create-button" type="submit">
                New Post   
              </Button>
            </Link>
          </ButtonWrapper>
          {/* if accessToken go to NavLinkUser */}
          <NavLinksUser />
          <ButtonWrapper>
            <Button onClick={onButtonClick} > Logout </Button>
          </ButtonWrapper>
        </NavMenu>
      </NavbarWrapper>
      </>
    )
  } else { 
    return (  
      <>
        <NavbarWrapper>
          <LogoWrapper>
            <FiMenu style={ style } />
          {/* <Logo />         */}
          </LogoWrapper>
          <NavMenu>
            <NavLinksVisitor />
          </NavMenu>
          <ButtonWrapper>
            <Link to="/login">
              <Button>
                Login
              </Button>
            </Link>
          </ButtonWrapper>     
        </NavbarWrapper>
      </>
)};
};

export default Navbar;
